import "./projects-path.css";

import { Link } from "react-router-dom";
import web from "../../../../img/web.png";
import img2 from "../../../../img/6.png";
import img3 from "../../../../img/3 copy.png";
import img4 from "../../../../img/5.png";
import img5 from "../../../../img/4 copy.png";
import img6 from "../../../../img/7.png";
export default function ProjectsPath() {
  return (
    <>
      <div className="paths">
        <Link to={"web"} style={{ textDecoration: "none" }}>
          <div className="paths-div" style={{backgroundImage:{web}}}>
          </div>
        </Link>

        <Link to={"android"} style={{ textDecoration: "none" }}>
          <div className="paths-div2">

          </div>
        </Link>

        <Link to={"ios"} style={{ textDecoration: "none" }}>
          <div className="paths-div3">

          </div>
        </Link>

        <Link to={"ux"} style={{ textDecoration: "none" }}>
          <div className="paths-div4">

          </div>
        </Link>

        <Link to={"ui"} style={{ textDecoration: "none" }}>
          <div className="paths-div">

          </div>
        </Link>

        <Link to={"security"} style={{ textDecoration: "none" }}>
          <div className="paths-div">

          </div>
        </Link>
      </div>
    </>
  );
}
